import React, { useEffect, useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import './TeamsWithProposalPage.css';
import useRoom from '../../hooks/useRoom';

const TeamsWithProposalPage = () => {
  const navigate = useNavigate();
  const { roomId } = useParams();
  const { fetchTeams, isLoading } = useRoom();
  const [teamsWithProposals, setTeamsWithProposals] = useState([]);

  useEffect(() => {
    const loadTeams = async () => {
      if (!roomId) return;
      const teams = await fetchTeams(roomId);
      setTeamsWithProposals(teams);
    };
    loadTeams();
  }, [roomId, fetchTeams]);

  return (
    <div className="room-page">
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Teams with Proposals</h1>
            <p className="creator-info">
              {teamsWithProposals.length} {teamsWithProposals.length === 1 ? 'team' : 'teams'} with proposals
            </p>
          </div>
          <div className="header-actions">
            <button 
              onClick={() => navigate('/')} 
              className="secondary-button"
            >
              ← Back to Home
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {isLoading ? (
          <div className="loading-container">
            <div className="loading-spinner"></div>
            <p>Loading teams...</p>
          </div>
        ) : teamsWithProposals.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Research">👥</span>
            </div>
            <h3>No Teams Available</h3>
            <p>Generate teams and proposals to view them here</p>
            <button 
              onClick={() => navigate(-1)} 
              className="primary-button"
            >
              Go Back
            </button>
          </div>
        ) : (
          <div className="teams-proposals-list">
            {teamsWithProposals.map((team) => (
              <div key={team.team_id} className="team-proposal-container">
                {/* Left Panel - Team Info */}
                <div className="team-info-panel">
                  <div className="team-header">
                    <h2>Team {team.team_id}</h2>
                    <span className="team-meta">
                      {team.team_size} member{team.team_size !== 1 ? 's' : ''}
                    </span>
                  </div>

                  <div className="team-section">
                    <h3 className="section-title">
                      <span className="section-icon">🔍</span> Research Focus
                    </h3>
                    <div className="tags-container">
                      {team.team_research_areas.map((area, idx) => (
                        <span key={idx} className="research-tag">{area}</span>
                      ))}
                    </div>
                  </div>

                  <div className="team-section">
                    <h3 className="section-title">
                      <span className="section-icon">👥</span> Members
                    </h3>
                    <div className="members-list">
                      {team.members.map((member) => (
                        <div key={member} className="member-item">
                          <div className="member-name">{member}</div>
                          <div className="member-expertise">
                            {team.member_fields[member].map((field, idx) => (
                              <span key={idx} className="expertise-tag">{field}</span>
                            ))}
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>

                {/* Right Panel - Proposals */}
                <div className="proposals-panel">
                  <div className="proposals-header">
                    <h3>
                      <span className="section-icon">📑</span> Project Proposals
                    </h3>
                    <span className="proposals-count">
                      {team.project_proposals?.length || 0} proposal{team.project_proposals?.length !== 1 ? 's' : ''}
                    </span>
                  </div>

                  <div className="proposals-list">
                    {team.project_proposals?.length > 0 ? (
                      team.project_proposals.map((proposal, idx) => (
                        <div key={idx} className="proposal-card">
                          <div className="proposal-header">
                            <h4>Proposal #{idx + 1}</h4>
                            {proposal.score && (
                              <span className="proposal-score">
                                Score: {proposal.score}
                              </span>
                            )}
                          </div>
                          <div className="proposal-content">
                            <p className="proposal-title">{proposal.title || 'Untitled Proposal'}</p>
                            <p className="proposal-description">{proposal.description}</p>
                            {proposal.key_points?.length > 0 && (
                              <div className="proposal-key-points">
                                <h5>Key Points:</h5>
                                <ul>
                                  {proposal.key_points.map((point, i) => (
                                    <li key={i}>{point}</li>
                                  ))}
                                </ul>
                              </div>
                            )}
                          </div>
                        </div>
                      ))
                    ) : (
                      <div className="no-proposals">
                        No proposals generated for this team
                      </div>
                    )}
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default TeamsWithProposalPage;
